package com.licitacija.mk.models;import com.fasterxml.jackson.annotation.JsonIgnore;import javax.persistence.*;import javax.validation.constraints.NotNull;import java.util.ArrayList;import java.util.List;@Entity()@Table(name = "\"User\"")public class User {    @Id    @GeneratedValue(strategy = GenerationType.SEQUENCE)    private long userId;    @ManyToOne    @JoinColumn(name = "city_id")    private City city;    @NotNull    @Enumerated(EnumType.STRING)    private AuthProvider provider;    private String providerId;    private String username;    private String email;    private String name;    private String phone;    @JsonIgnore    private String password;    public void setUserId(int userId) {        this.userId = userId;    }    @OneToMany(mappedBy = "givenByUser", cascade = CascadeType.REMOVE, orphanRemoval = true)    @JsonIgnore    private List<Offer> offers;    @OneToMany(mappedBy = "user", cascade = CascadeType.REMOVE, orphanRemoval = true)    private List<Product> userProducts;    @OneToMany(mappedBy = "user", cascade = CascadeType.REMOVE, orphanRemoval = true)    @JsonIgnore    private List<Interest> interests;    public User() {    }    public User(City city, String username, String email, String full_name, String phone) {        this.city = city;        this.username = username;        this.email = email;        this.name = full_name;        this.phone = phone;    }    public long getUserId() {        return userId;    }    public City getCity() {        return city;    }    public void setCity(City city) {        this.city = city;    }    public String getUsername() {        return username;    }    public void setUsername(String username) {        this.username = username;    }    public String getEmail() {        return email;    }    public void setEmail(String email) {        this.email = email;    }    public String getName() {        return name;    }    public void setName(String name) {        this.name = name;    }    public String getPhone() {        return phone;    }    public void setPhone(String phone) {        this.phone = phone;    }    public List<Offer> getOffers() {        return offers;    }    public void setOffers(List<Offer> offers) {        this.offers = offers;    }    public AuthProvider getProvider() {        return provider;    }    public String getProviderId() {        return providerId;    }    public String getPassword() {        return password;    }    public List<Product> getUserProducts() {        return userProducts;    }    public List<Interest> getInterests() {        return interests;    }    public void setUserId(long userId) {        this.userId = userId;    }    public void setProvider(AuthProvider provider) {        this.provider = provider;    }    public void setProviderId(String providerId) {        this.providerId = providerId;    }    public void setPassword(String password) {        this.password = password;    }    public void setUserProducts(List<Product> userProducts) {        this.userProducts = userProducts;    }    public void setInterests(List<Interest> interests) {        this.interests = interests;    }}